import React from 'react';
import "./style.css";

function Home(props) {
    return (
        <div>
            <img
                src={require("../assets/re-mountain.png")}
                alt="re-mountain"
                id="re-mountain" 
            />
            <div>
                <h1 className="firstName">Rupert</h1>
            </div>
            <div>
            <h1 className="lastName">Paterson</h1>
            </div>

        </div>
    );
}

export default Home;
